#include <iostream>
#include <fstream>
#include <sstream>
#include <string>
#include <vector>
#include <map>
#include <set>
#include <unordered_map>
#include <unordered_set>
#include <iterator>
#include <algorithm>

using namespace std;

class Solution {
 public:
  string shortestPalindrome(string s) {
    // 1) Find longest palindrome p starts at 0 (O(n^2))
    // 2) Return reversed(s.substr(p.size())) + s
    size_t n = s.size();
    if (n <= 1) return s;

    // Only use up right triangle of this table
    vector<vector<bool> > isPalindrome(n, vector<bool>(n, false));
    for (size_t i = 0; i < n; ++i) isPalindrome[i][i] = true;
    for (size_t i = 0; i < n - 1; ++i) isPalindrome[i + 1][i] = true;
    for (size_t k = 1; k <= n; ++k) {
      for (size_t i = 0; i < n - k; ++i) {
        size_t j = i + k;
        isPalindrome[i][j] = (s[i] == s[j] && isPalindrome[i + 1][j - 1]);
      }
    }

    size_t maxPalindromeLen = 0;
    for (size_t i = 0; i < n; ++i) {
      if (isPalindrome[0][i] == true) {
        maxPalindromeLen = i + 1;
      }
    }

    string pad = s.substr(maxPalindromeLen);
    reverse(pad.begin(), pad.end());

    return pad + s;
  }
};

void test(string s) {
  std::cout << "s: " << s << "\n";
  Solution sol;
  std::cout << "shortestPalindrome: " << sol.shortestPalindrome(s) << "\n";
}

int main(int argc, char* argv[]) {
  {
    test("aacecaaa");
  }
  {
    test("abcd");
  }
  {
    test("");
  }
  {
    test("");
  }
  return 0;
}
